INSERT INTO `title` VALUES ('300', 'Tekken: Blood Vengeance', 'Tekken: Blood Vengeance', '1', 'Animation, Action,SciFi', '2011', 'http://www.imdb.com/title/tt2005363/?ref_=fn_al_tt_1', 'g:\\filmovi\\tekken blood vengence.mkv', 'High school student Ling Xiaoyu is recruited by Anna Williams of G Corporation to transfer to Kyoto University and gather information on a student named Shin Kamiya. Meanwhile, Jin Kazama, the current head of the Mishima Zaibatsu, sends Alisa Bosconovitch to the university for the same mission. Though they do not know each other\'s true motives, Xiaoyu and Alisa become close friends. However, their friendship is put to the test when Shin is captured by an unknown assailant.', '', 'Christine Marie Cabanos, Isshin Chiba, Kyle Hebert, Unsh Ishizuka', 'http://1.bp.blogspot.com/-O3jjX7lU648/UsQvDDzfEWI/AAAAAAAAHms/XIQJk6qaSNA/s1600/Tekken Blood Vengeance.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('301', 'The Amazing Spider-Man', 'The Amazing Spider-Man', '1', 'Action, Adventure, Fantasy', '2012', 'http://www.imdb.com/title/tt2233044/?ref_=fn_al_tt_1', 'g:\\filmovi\\the amazing spider-man', 'Like most teenagers, Peter is trying to figure out who he is and how he got to be the person he is today. Peter is also finding his way with his first high school crush, Gwen Stacy, and together, they struggle with love, commitment, and secrets. As Peter discovers a mysterious briefcase that belonged to his father, he begins a quest to understand his parents\' disappearance - leading him directly to Oscorp and the lab of Dr Curt Connors, his father\'s former partner. As Spider-Man is set on a collision course with Connors\' alter-ego, The Lizard, Peter will make life-altering choices to use his powers and shape his destiny to become a hero.', '', 'Andrew Garfield, Emma Stone, Rhys Ifans, Denis Leary', 'http://ia.media-imdb.com/images/M/MV5BMjMyOTM4MDMxNV5BMl5BanBnXkFtZTcwNjIyNzExOA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('302', 'The Amazing Spider-Man 2', 'The Amazing Spider-Man 2', '1', 'Action, Adventure, Fantasy', '2014', 'http://www.imdb.com/title/tt4058796/?ref_=fn_al_tt_1', 'g:\\filmovi\\the amazing spider-man 2 2014 720p webrip xvid ac3-bhrg', 'We\'ve always known that Spider-Man\'s most important conflict has been within himself: the struggle between the ordinary obligations of Peter Parker and the extraordinary responsibilities of Spider-Man. But in The Amazing Spider-Man 2, Peter Parker finds that his greatest battle is about to begin. It\'s great to be Spider-Man. For Peter Parker, there\'s no feeling quite like swinging between skyscrapers, embracing being the hero, and spending time with Gwen. But being Spider-Man comes at a price: only Spider-Man can protect his fellow New Yorkers from the formidable villains that threaten the city. With the emergence of Electro, Peter must confront a foe far more powerful than he. And as his old friend, Harry Osborn, returns, Peter comes to realize that all of his enemies have one thing in common: Oscorp.', '720p', 'Andrew Garfield, Emma Stone, Jamie Foxx, Dane DeHaan', 'http://ia.media-imdb.com/images/M/MV5BOTA5NDYxNTg0OV5BMl5BanBnXkFtZTgwODE5NzU1MTE@._V1_SX300.jpg', '0', '0', '0', '0');
