INSERT INTO `title` VALUES ('368', 'Contraband/Underworld Awakening/Joyful Noise', 'underworld awakening', '1', 'News', '2012', 'http://www.imdb.com/title/tt3006408/?ref_=fn_al_tt_1', 'g:\\filmovi\\underworld_awakening_2012_r5_line_readnfo_xvid-ftw.avi', 'N/A', '', 'N/A', 'http://ia.media-imdb.com/images/M/MV5BMjExMjU1MTQ3Nl5BMl5BanBnXkFtZTgwNzQ2Njk3MDE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('369', 'Universal Soldier: Day of Reckoning', 'Universal Soldier: Day of Reckoning', '1', 'Action, Horror, Mystery', '2012', 'http://www.imdb.com/title/tt1659343/?ref_=fn_al_tt_1', 'g:\\filmovi\\Universal Soldier  Day of Reckoning', 'John awakens from a coma to discover his wife and daughter were slaughtered in a brutal home invasion. Haunted by images of the attack, he vows to kill the man responsible: Luc Deveraux. While John tries to piece his reality back together, things get more complicated when he is pursued by a relentless UniSol named Magnus. Meanwhile, Deveraux and surviving UniSol Andrew Scott are preparing to battle anarchy and build a new order ruled by Unisols without government oversight. They are weeding out the weak and constantly testing their strongest warriors in brutal, life-and-death combat. Luc has emerged operating the Unisol Church of Eventualism, taking in wayward Unisols whom the government has been secretly operating as remote-controlled sleeper agents. His mission is to liberate these Unisols from the implanted memories and the lies the government has inserted in them. As John gets closer to Deveraux and the rogue army of genetically enhanced warriors, he discovers more about himself and begins to call into question everything he believed to be true.', '', 'Scott Adkins, Dolph Lundgren, Andrei Arlovski, Jean-Claude Van Damme', 'http://ia.media-imdb.com/images/M/MV5BMTM3ODMxMDY0MF5BMl5BanBnXkFtZTcwNDc3MTY0OA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('370', 'Unknown', 'unknown', '1', 'Action, Mystery, Thriller', '2011', 'http://www.imdb.com/title/tt1401152/?ref_=fn_al_tt_1', 'g:\\filmovi\\unknown.2011', 'A man awakens from a coma, only to discover that someone has taken on his identity and that no one, (not even his wife), believes him. With the help of a young woman, he sets out to prove who he is.', '', 'Liam Neeson, Diane Kruger, January Jones, Aidan Quinn', 'http://ia.media-imdb.com/images/M/MV5BODA4NTk3MTQwN15BMl5BanBnXkFtZTcwNjUwMTMxNA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('371', 'Van Helsing', 'van', '1', 'Action, Adventure, Fantasy', '2004', 'http://www.imdb.com/title/tt0338526/?ref_=fn_al_tt_1', 'g:\\filmovi\\van hellsing london assignment', 'The notorious monster hunter is sent to Transylvania to stop Count Dracula who is using Dr. Frankenstein\'s research and a werewolf for some sinister purpose.', '', 'Hugh Jackman, Kate Beckinsale, Richard Roxburgh, David Wenham', 'http://ia.media-imdb.com/images/M/MV5BMTY0NjcyOTUxNV5BMl5BanBnXkFtZTYwNjMxNjc2._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('372', 'Wanted', 'wanted', '1', 'Action, Crime, Fantasy', '2008', 'http://www.imdb.com/title/tt0493464/?ref_=fn_al_tt_1', 'g:\\filmovi\\wanted', 'A frustrated office worker learns that he is the son of a professional assassin, and that he shares his father\'s superhuman killing abilities.', '', 'James McAvoy, Morgan Freeman, Angelina Jolie, Terence Stamp', 'http://ia.media-imdb.com/images/M/MV5BMTQwNDM2MTMwMl5BMl5BanBnXkFtZTgwMjE4NjQxMTE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('373', 'War', 'war', '1', 'Action, Crime, Thriller', '2007', 'http://www.imdb.com/title/tt0499556/?ref_=fn_al_tt_1', 'g:\\filmovi\\war.2007.dvdrip.xvid.rosubbed-genti', 'An FBI Agent seeks vengeance on a mysterious assassin known as \"Rogue\" who murdered his partner.', 'DVD rip', 'Jet Li, Jason Statham, John Lone, Devon Aoki', 'http://ia.media-imdb.com/images/M/MV5BMTgzNTA4MTc3OF5BMl5BanBnXkFtZTcwOTA0ODk0MQ@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('374', 'Warrior', 'Warrior', '1', 'Drama, Sport', '2011', 'http://www.imdb.com/title/tt2077795/?ref_=fn_al_tt_1', 'g:\\filmovi\\warrior.2011.720p.brrip.x264.aac-vision', 'Two brothers face the fight of a lifetime - and the wreckage of their broken family - within the brutal, high-stakes world of Mixed Martial Arts (MMA) fighting in Lionsgate\'s action/drama, WARRIOR. An ex-Marine haunted by a tragic past, Tommy Riordan returns to his hometown of Pittsburgh and enlists his father, a recovered alcoholic and his former coach, to train him for an MMA tournament awarding the biggest purse in the history of the sport. As Tommy blazes a violent path towards the title prize, his brother, Brendan, a former MMA fighter unable to make ends meet as a public school teacher, returns to the amateur ring to provide for his family. Even though years have passed, recriminations and past betrayals keep Brendan bitterly estranged from both Tommy and his father. But when Brendan\'s unlikely rise as an underdog sets him on a collision course with Tommy, the two brothers must finally confront the forces that tore them apart, all the while waging the most intense, winner-takes-all battle of their lives.', '720p', 'Joel Edgerton, Tom Hardy, Nick Nolte, Jennifer Morrison', 'http://ia.media-imdb.com/images/M/MV5BMTk4ODk5MTMyNV5BMl5BanBnXkFtZTcwMDMyNTg0Ng@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('375', 'Tales of the Black Freighter', 'Tales of the Black Freighter', '1', 'Animation, Short, Action', '2009', 'http://www.imdb.com/title/tt0409459/?ref_=fn_al_tt_1', 'g:\\filmovi\\watchmen', 'A mariner survives an attack from the dreaded pirates of the Black Freighter, but his struggle to return home to warn it has a horrific cost.', '', 'Gerard Butler, Cam Clarke, Siobhan Flynn, Jared Harris', 'http://ia.media-imdb.com/images/M/MV5BMTMzNjg5MzU1MF5BMl5BanBnXkFtZTcwNjAwNDMzMg@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('376', 'White Noise', 'white noise', '1', 'Drama, Horror, Mystery', '2005', 'http://www.imdb.com/title/tt0375210/?ref_=fn_al_tt_1', 'g:\\filmovi\\white noise', 'An architect\'s desire to speak with his wife from beyond the grave, becomes an obsession with supernatural repercussions.', '', 'Michael Keaton, Chandra West, Deborah Kara Unger, Ian McNeice', 'http://ia.media-imdb.com/images/M/MV5BMTYzNjA2MDk0NF5BMl5BanBnXkFtZTcwNjkwODcyMQ@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('377', 'Snow White and the Huntsman', 'white', '1', 'Action, Drama, Fantasy', '2012', 'http://www.imdb.com/title/tt1735898/?ref_=fn_al_tt_1', 'g:\\filmovi\\white.escp.2013', 'In a twist to the fairy tale, the Huntsman ordered to take Snow White into the woods to be killed winds up becoming her protector and mentor in a quest to vanquish the Evil Queen.', '', 'Kristen Stewart, Chris Hemsworth, Charlize Theron, Sam Claflin', 'http://ia.media-imdb.com/images/M/MV5BMTQ1NDA0MTk5OV5BMl5BanBnXkFtZTcwMTM4NDMwNw@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('379', 'Wolverine and the X-Men', 'wolverine and the x men', '2', 'Animation, Action, Adventure', '2008', 'http://www.imdb.com/title/tt0772145/?ref_=fn_al_tt_1', 'g:\\filmovi\\wolverine and the x men fight for the future', 'After an explosion at the school, the x-men went their seperate ways. But, they must unite once again under the leadership of wolverine to prevent an inevitable war while also dealing with present problem.', '', 'Steve Blum, Jim Ward, Nolan North, Fred Tatasciore', 'http://ia.media-imdb.com/images/M/MV5BNzk4Nzg3NjMyMV5BMl5BanBnXkFtZTcwMjk3MjU0Mg@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('380', 'Wonder Woman', 'Wonder Woman', '1', 'Animation, Action, Adventure', '2009', 'http://www.imdb.com/title/tt0070926/?ref_=fn_al_tt_1', 'g:\\filmovi\\wonder women', 'In antiquity, the Amazons defeat the war god, Ares, and Zeus charges them to hold him prisoner as eternally young warriors on the hidden island of Themyscira. Centuries later, US Air Force pilot Steve Trevor is lured to crash land on the island and the distraction of that trespass allows Ares to escape. In response, Princess Diana wins the responsibility to both take Trevor home and recapture the fugitive god. Steve Trevor offers to help and together this disparate pair must not only overcome Ares\' efforts to achieve a bloody revenge, but also reconcile their own conflicting world views in an adventure that would be the first for the greatest of the female superheroes.', '', 'Keri Russell, Nathan Fillion, Alfred Molina, Rosario Dawson', 'http://ia.media-imdb.com/images/M/MV5BMjAwNjk5MDEyOF5BMl5BanBnXkFtZTcwMzA5MzUxMg@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('381', 'Sky Blue', 'Sky Blue', '1', 'Action, Fantasy, Animation', '2003', 'http://www.imdb.com/title/tt0436289/?ref_=fn_al_tt_1', 'g:\\filmovi\\wonderful days (2003) [1080p]', 'Civilization has been destroyed by war and pollution, but the survivors have built the last city of Ecoban. As most natural resources have been exhausted, Ecoban is powered by pollution. The citizens of Ecoban need to continue creating this pollution leading them into conflict with the inhabitants of Marr while one man just wants to clear away the clouds and see the sky', '1080p', 'Andrew Ableson, Cathy Cavadini, Joon-ho Chung, Mark Lindsay', 'http://ia.media-imdb.com/images/M/MV5BMTI0OTY1NzU4M15BMl5BanBnXkFtZTcwNDA3ODcyMQ@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('382', 'World War Z', 'world war z', '1', 'Action, Adventure, Horror', '2013', 'http://www.imdb.com/title/tt0816711/?ref_=fn_al_tt_1', 'g:\\filmovi\\world.war.z.2013.unrated.cut.1080p.brrip.x264.aac-rarbg', 'United Nations employee Gerry Lane traverses the world in a race against time to stop the Zombie pandemic that is toppling armies and governments, and threatening to destroy humanity itself.', '1080p', 'Brad Pitt, Mireille Enos, Daniella Kertesz, James Badge Dale', 'http://ia.media-imdb.com/images/M/MV5BMTg0NTgxMjIxOF5BMl5BanBnXkFtZTcwMDM0MDY1OQ@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('383', 'Wreck-It Ralph', 'Wreck-It Ralph', '1', 'Animation, Adventure, Comedy', '2012', 'http://www.imdb.com/title/tt2338250/?ref_=fn_al_tt_1', 'g:\\filmovi\\wreck it ralph', 'Wreck-It Ralph longs to be as beloved as his game\'s perfect Good Guy, Fix-It Felix. Problem is, nobody loves a Bad Guy. But they do love heroes... so when a modern, first-person shooter game arrives featuring tough-as-nails Sergeant Calhoun, Ralph sees it as his ticket to heroism and happiness. He sneaks into the game with a simple plan -- win a medal -- but soon wrecks everything, and accidentally unleashes a deadly enemy that threatens every game in the arcade. Ralph\'s only hope? Vanellope von Schweetz, a young troublemaking \"glitch\" from a candy-coated cart racing game who might just be the one to teach Ralph what it means to be a Good Guy. But will he realize he is good enough to become a hero before it\'s \"Game Over\" for the entire arcade?', '', 'John C. Reilly, Sarah Silverman, Jack McBrayer, Jane Lynch', 'http://ia.media-imdb.com/images/M/MV5BNzMxNTExOTkyMF5BMl5BanBnXkFtZTcwMzEyNDc0OA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('384', 'X-Men: First Class', 'x men first class', '1', 'Action, Adventure,SciFi', '2011', 'http://www.imdb.com/title/tt1270798/?ref_=fn_al_tt_1', 'g:\\filmovi\\x men first class', 'In 1962, the United States government enlists the help of Mutants with superhuman abilities to stop a malicious dictator who is determined to start world war III.', '', 'James McAvoy, Laurence Belcher, Michael Fassbender, Bill Milner', 'http://ia.media-imdb.com/images/M/MV5BMTg5OTMxNzk4Nl5BMl5BanBnXkFtZTcwOTk1MjAwNQ@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('385', 'Blood', 'blood & chrome', '1', 'Crime, Drama, Thriller', '2012', 'http://www.imdb.com/title/tt2078552/?ref_=fn_al_tt_1', 'h:\\filmovi\\blood & chrome', 'Thriller charting the moral collapse of a police family. Two cop brothers, smothered by the shadow of their former police chief father, must investigate a crime they themselves have committed.', '', 'Paul Bettany, Mark Strong, Brian Cox, Stephen Graham', 'http://ia.media-imdb.com/images/M/MV5BMTkyNzg1OTMyN15BMl5BanBnXkFtZTcwNzgzOTE4OQ@@._V1_SX300.jpg', '0', '0', '0', '1');
INSERT INTO `title` VALUES ('386', 'Afro Samurai', 'afro samurai', '1', 'Animation, Action, Adventure', '2007', 'http://www.imdb.com/title/tt0465316/?ref_=fn_al_tt_1', 'h:\\serije\\afro samurai', 'A Black samurai goes on a mission to avenge the wrongful death of his father in a futuristic feudal Japan.', '', 'Samuel L. Jackson, Phil LaMarr, Yuri Lowenthal, Greg Eagles', 'http://ia.media-imdb.com/images/M/MV5BMTg4NjY1MTUyNl5BMl5BanBnXkFtZTcwODU2OTU3MQ@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('388', 'Anger Management', 'anger management', '1', 'Comedy', '2003', 'http://www.imdb.com/title/tt0305224/?ref_=fn_al_tt_1', 'h:\\serije\\anger management', 'Sandler plays a businessman who is wrongly sentenced to an anger-management program, where he meets an aggressive instructor.', '', 'Adam Sandler, Jack Nicholson, Marisa Tomei, Luis Guzmn', 'http://ia.media-imdb.com/images/M/MV5BMTQ1NTIxMTY5OF5BMl5BanBnXkFtZTYwODI3Mzg5._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('389', 'Arrow', 'arrow', '2', 'Action, Adventure, Crime', '2012', 'http://www.imdb.com/title/tt2193021/?ref_=fn_al_tt_1', 'h:\\serije\\arrow', 'Spoiled billionaire playboy Oliver Queen is missing and presumed dead when his yacht is lost at sea. He returns five years later a changed man, determined to clean up the city as a hooded vigilante armed with a bow.', '', 'Stephen Amell, Katie Cassidy, David Ramsey, Willa Holland', 'http://ia.media-imdb.com/images/M/MV5BMTg3OTc0NzkyOV5BMl5BanBnXkFtZTgwMDMwMTM3MjE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('390', 'Astonishing X-Men: Gifted', 'astonishing x men', '2', 'Animation, Action,SciFi', '2009', 'http://www.imdb.com/title/tt2047677/?ref_=fn_al_tt_1', 'h:\\serije\\astonishing x men', 'Much ensues after the government has found the cure for the mutants.', '', 'Gregory Abbey, Eva Christensen, Michal Friedman, Dan Green', 'N/A', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('391', 'Avatar', 'avatar', '1', 'Action, Adventure, Fantasy', '2009', 'http://www.imdb.com/title/tt0499549/?ref_=fn_al_tt_1', 'h:\\serije\\avatar legend of korra', 'A paraplegic Marine dispatched to the moon Pandora on a unique mission becomes torn between following his orders and protecting the world he feels is his home.', '', 'Sam Worthington, Zoe Saldana, Sigourney Weaver, Stephen Lang', 'http://ia.media-imdb.com/images/M/MV5BMTYwOTEwNjAzMl5BMl5BanBnXkFtZTcwODc5MTUwMw@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('392', 'Avengers assemble', 'Avengers assemble', '2', 'Animation, Action, Family', '2012', 'http://www.imdb.com/title/tt2207840/?ref_=fn_al_tt_1', 'e:\\serije\\avengers assemble', 'The Avengers and his allies face the ultimate test when Galactus, the Devourer of Planets comes to consume Earth.', '', 'Brian Bloom, Chris Cox, David Kaufman, Colleen O\'Shaughnessey', 'http://www.ew.com/sites/default/files/i/2013/03/08/Avengers-Assemble.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('393', 'Being Human', 'being human', '2', 'Drama, Fantasy, Horror', '2011', 'http://www.imdb.com/title/tt1595680/?ref_=fn_al_tt_1', 'h:\\serije\\being human', 'Three twenty-somethings share a house and try to live a normal life despite being a ghost, a werewolf, and a vampire.', '', 'Sam Witwer, Meaghan Rath, Sam Huntington, Kristen Hager', 'http://ia.media-imdb.com/images/M/MV5BMjI4NjU3ODcxOF5BMl5BanBnXkFtZTgwNjY4Mjk5MDE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('394', 'Da Vinci\'s Demons', 'Da Vinci\'s Demons', '1', 'Adventure, Drama, Fantasy', '2013', 'http://www.imdb.com/title/tt0443781/?ref_=fn_al_tt_1', 'h:\\serije\\davinci\'s demons', 'Written by David S. Goyer, the series follows the \"untold\" story of Leonardo Da Vinci: the genius during his early years in Renaissance Florence. As a 25-year old artist, inventor, swordsman, lover, dreamer and idealist, he struggles to live within the confines of his own reality and time as he begins to not only see the future, but invent it.', '', 'Tom Riley, Gregg Chillin, Eros Vlahos, Laura Haddock', 'http://ia.media-imdb.com/images/M/MV5BMTc5NjY5MzM2M15BMl5BanBnXkFtZTgwMjA5NzMxMTE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('395', 'Defiance', 'Defiance', '1', 'Action, Drama,SciFi', '2013', 'http://www.imdb.com/title/tt1034303/?ref_=fn_al_tt_1', 'h:\\serije\\defiance', 'In the year 2046, it\'s a new Earth - with new rules. Over thirty years after various alien races arrived on Earth, the landscape is completely altered, terraformed nearly beyond recognition. To the town of Defiance, on what used to be St. Louis, comes the mysterious Nolan (Grant Bowler) and his charge, Irisa (Stephanie Leonidas). As they settle into town - overseen by the mayor, Amanda Rosewater (Julie Benz) and filled with residents like the powerful Rafe McCawley (Graham Greene), enterprising lounge owner Kenya (Mia Kirshner) and the ambitious, alien Tarrs (Tony Curran and Jaime Murray) - events begin to unfold that threaten the fragile peace this border town has fought for.', '', 'Grant Bowler, Stephanie Leonidas, Julie Benz, Graham Greene', 'http://ia.media-imdb.com/images/M/MV5BMjkwODU5ODk5MF5BMl5BanBnXkFtZTgwMDQzMTYzNTE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('396', 'Drawn Together', 'drawn together', '2', 'Animation, Comedy', '20042008', 'http://www.imdb.com/title/tt0386180/?ref_=fn_al_tt_1', 'h:\\serije\\drawn together', 'A parody of reality shows cast with spoofs of several famous types of animated characters.', '', 'Adam Carolla, Jess Harnell, Abbey McBride, Jack Plotnick', 'http://ia.media-imdb.com/images/M/MV5BMTI3MDAxMDgzMV5BMl5BanBnXkFtZTcwNDQ4MjEzMQ@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('397', 'The Avengers: Earth\'s Mightiest Heroes', 'earth\'s mightiest heroes', '2', 'Animation, Action, Family', '20102012', 'http://www.imdb.com/title/tt1626038/?ref_=fn_al_tt_1', 'h:\\serije\\earth\'s mightiest heroes', 'After 74 villains break out of prison, Marvel\'s most powerful superheroes team up to capture all of them, and also to defend the Earth from widespread threats.', '', 'Eric Loomis, Brian Bloom, Colleen O\'Shaughnessey, Rick D. Wasserman', 'http://ia.media-imdb.com/images/M/MV5BMTMzNTk2ODEyN15BMl5BanBnXkFtZTcwNDA1ODAyNw@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('398', 'Ergo Proxy', 'ergo proxy', '2', 'Animation, Adventure, Crime', '2006', 'http://www.imdb.com/title/tt0791205/?ref_=fn_al_tt_1', 'h:\\serije\\ergo proxy', 'In a post-apocalyptic future humans live in peace with androids in a domed city. However, a strange series of murders has intruded into bored inspector Re-l Mayer\'s life.', '', 'Rachel Hirschfeld, Taliesin Jaffe, Liam O\'Brien, Karen Thompson', 'http://ia.media-imdb.com/images/M/MV5BMTIyMzg3MTA1Nl5BMl5BanBnXkFtZTcwMzMwOTI0MQ@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('399', 'Eureka', 'eureka', '2', 'Comedy, Drama,SciFi', '20062012', 'http://www.imdb.com/title/tt0796264/?ref_=fn_al_tt_1', 'h:\\serije\\eureka', 'The best minds in the US are tucked away in a remote town where they build futuristic inventions for the government\'s benefit.', '', 'Colin Ferguson, Salli Richardson-Whitfield, Erica Cerra, Neil Grayston', 'http://ia.media-imdb.com/images/M/MV5BMTkyMDQ0NDY1M15BMl5BanBnXkFtZTcwOTU1Njk3MQ@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('400', 'Everest', 'everest', '1', 'Documentary, Short', '1998', 'http://www.imdb.com/title/tt0120661/?ref_=fn_al_tt_1', 'h:\\serije\\everest ultimate engineer edition v5.50 build 2253', 'An international team of climbers ascends Mt. Everest in the spring of 1996. The film depicts their lengthy preparations for the climb, their trek to the summit, and their successful return...', '', 'Liam Neeson, Lhakpa Dorji, Dorje Sherpa, Ed Viesturs', 'http://ia.media-imdb.com/images/M/MV5BMTUwNzA0ODg1OV5BMl5BanBnXkFtZTcwMzA3MDUxMQ@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('402', 'Falling Skies', 'falling skies', '2', 'Action,SciFi, Thriller', '2011', 'http://www.imdb.com/title/tt1462059/?ref_=fn_al_tt_1', 'h:\\serije\\falling skies', 'Survivors of an alien attack on earth gather together to fight for their lives and fight back.', '', 'Maxim Knight, Noah Wyle, Drew Roy, Will Patton', 'http://ia.media-imdb.com/images/M/MV5BMTQ2NzE1NjM3Nl5BMl5BanBnXkFtZTcwNDExODY2OQ@@._V1_SX300.jpg', '0', '0', '0', '0');
