INSERT INTO `title` VALUES ('415', 'Mortal Kombat: Legacy', 'Mortal Kombat: Legacy', '1', 'Action, Crime, Fantasy', '2011', 'http://www.imdb.com/title/tt2106554/?ref_=fn_al_tt_1', 'h:\\serije\\mortal kombat legacy', 'The first season of Mortal Kombat Legacy is a prequel to the original game, explaining the background stories of several characters from the series and demonstrating their reasons for participating in the upcoming tenth Mortal Kombat tournament on which the first game was based. The episodes are non-linear with minimal continuity and each devoted to the story of a specific character or characters. The second season covers the tournament itself.', '', 'Casper Van Dien, Ian Anthony Dale, Samantha Jo, Kim Do Nguyen', 'http://vignette1.wikia.nocookie.net/mkwikia/images/4/40/Legacy.jpg/revision/latest/scale-to-width/200?cb=20110815002301', '0', '0', '0', '0');
