INSERT INTO `title` VALUES ('418', 'Robot Chicken: Star Wars Episode III', 'robot chicken star wars episode', '1', 'Animation, Comedy,SciFi', '2010', 'http://www.imdb.com/title/tt1691338/?ref_=fn_al_tt_1', 'h:\\serije\\robot.chicken.star.wars.episode.3.2010.hdtv.2hd.animated.avi', 'The Emmy Award-winning Robot Chicken returns with its third send-up of the Star Wars universe! In this all-new hour-long special, four very different characters -- Emperor Palpatine, Darth ...', '', 'Seth Green, Abraham Benrubi, Bob Bergen, Ahmed Best', 'http://ia.media-imdb.com/images/M/MV5BMjAyNTYzODM3OF5BMl5BanBnXkFtZTcwMTY4ODM4NA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('419', 'Sanctuary', 'sanctuary', '2', 'Crime, Mystery,SciFi', '2008', 'http://www.imdb.com/title/tt0965394/?ref_=fn_al_tt_1', 'h:\\serije\\sanctuary', 'Stem cells, gene therapy, transplants, and cloning have changed the definition of \"humanity\" in the modern world, but the darker side contains monsters that only few are brave enough to face, because the future lies in their hands.', '', 'Amanda Tapping, Robin Dunne, Christopher Heyerdahl, Ryan Robbins', 'http://ia.media-imdb.com/images/M/MV5BMTQ4MTI1NTQ3NV5BMl5BanBnXkFtZTcwNDI4Mjc5MQ@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('420', 'South Park', 'south park', '2', 'Animation, Comedy', '1997', 'http://www.imdb.com/title/tt0121955/?ref_=fn_al_tt_1', 'h:\\serije\\south park', 'Follows the misadventures of four irreverent grade-schoolers in the quiet, dysfunctional town of South Park, Colorado.', '', 'Trey Parker, Matt Stone, Mona Marshall, Isaac Hayes', 'http://ia.media-imdb.com/images/M/MV5BMTI5MTYyNDU3NF5BMl5BanBnXkFtZTYwNjU1MzM5._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('421', 'Spartacus: War of the Damned', 'Spartacus: War of the Damned', '1', 'Action, Adventure, Biography', '20102013', 'http://www.imdb.com/title/tt0054331/?ref_=fn_al_tt_1', 'h:\\serije\\spartacus', 'The inspiration behind this series is the Thracian Gladiator Spartacus, who led a slave uprising against the Roman Republic. The Thracians had been persuaded by Claudius Glaber to serve as auxiliaries in the Roman legions in a campaign against the Getae, who had often plundered Thracian lands. However after Glaber reneges on the deal and switches his attentions from the Getae to attack Mithridates in Asia Minor, the Thracians feel betrayed and mutiny. Captured by Glaber, Spartacus is condemned to death as a Gladiator, whilst his wife Sura is condemned to slavery. Spartacus, however, proves to be a formidable gladiator, and defeats the four gladiators tasked with executing him. He becomes a favorite of the crowd, leading Senator Albinius to commute his death sentence to a life of slavery. Spartacus is purchased by Batiatus for gladiator training, who promises to help him find Sura if he proves himself in training. As the series develops, the story follows the betrayals and machinations of Roman life and a tale of one man\'s heroic quest for vengeance.', '', 'Manu Bennett, Daniel Feuerriegel, Peter Mensah, Lucy Lawless', 'http://ia.media-imdb.com/images/M/MV5BOTA2NDU2MzM5Nl5BMl5BanBnXkFtZTcwMTk3Njg3OA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('422', 'Stargate: Atlantis', 'stargate atlantis', '2', 'Action, Drama,SciFi', '20042009', 'http://www.imdb.com/title/tt0374455/?ref_=fn_al_tt_1', 'h:\\serije\\stargate atlantis', 'An international team of scientists and military personnel discover a Stargate network in the Pegasus Galaxy and come face-to-face with a new, powerful enemy, The Wraith.', '', 'Joe Flanigan, Rachel Luttrell, David Hewlett, Jason Momoa', 'http://ia.media-imdb.com/images/M/MV5BMjI0MTI4MTY3N15BMl5BanBnXkFtZTcwMjg1NjQ4NA@@._V1_SX300.jpg', '0', '0', '0', '0');
