INSERT INTO `title` VALUES ('424', 'Supernatural', 'supernatural', '2', 'Drama, Fantasy, Horror', '2005', 'http://www.imdb.com/title/tt0460681/?ref_=fn_al_tt_1', 'h:\\serije\\supernatural', 'Two brothers follow their father\'s footsteps as \"hunters\" fighting evil supernatural beings of many kinds including monsters, demons, and gods that roam the earth.', '', 'Jared Padalecki, Jensen Ackles', 'http://ia.media-imdb.com/images/M/MV5BMTc2NzMxODU0NV5BMl5BanBnXkFtZTgwMjYyNzk1MjE@._V1_SX300.jpg', '0', '0', '0', '0');
