INSERT INTO `title` VALUES ('426', 'The Big Bang Theory', 'the big bang theory', '2', 'Comedy', '2007', 'http://www.imdb.com/title/tt0898266/?ref_=fn_al_tt_1', 'h:\\serije\\the big bang theory', 'A woman who moves into an apartment across the hall from two brilliant but socially awkward physicists shows them how little they know about life outside of the laboratory.', '', 'Johnny Galecki, Jim Parsons, Kaley Cuoco-Sweeting, Simon Helberg', 'http://ia.media-imdb.com/images/M/MV5BMjI1Mzc4MDUwNl5BMl5BanBnXkFtZTgwMDAzOTIxMjE@._V1_SX300.jpg', '0', '0', '0', '0');
