INSERT INTO `title` VALUES ('431', 'X-Men: Evolution', 'x men evolution', '2', 'Animation, Action, Drama', '20002003', 'http://www.imdb.com/title/tt0247827/?ref_=fn_al_tt_1', 'h:\\serije\\x men evolution', 'This rendition of X-Men features Cyclops, Jean Grey, Rogue, Nightcrawler, Shadowcat, and Spike as teenagers as they fight for a world that fears and hates them.', '', 'Kirby Morrow, Venus Terzo, David Kaye, Brad Swaile', 'http://ia.media-imdb.com/images/M/MV5BMTYwMzE0ODQyOF5BMl5BanBnXkFtZTcwMTc5NzUyMQ@@._V1_SX300.jpg', '0', '0', '0', '0');
