INSERT INTO `title` VALUES ('436', 'Angels and demons', 'Angels and demons', '1', 'Mystery, Thriller', '2009', 'http://www.imdb.com/title/tt0184215/?ref_=fn_al_tt_1', 'i:\\filmovi\\angels.and.demons.r5.line.xvid-devise', 'Following the murder of a physicist, Father Silvano Bentivoglio, a symbolist, Robert Langdon, and a scientist, Vittoria Vetra, are on an adventure involving a secret brotherhood, the Illuminati. Clues lead them all around the Vatican, including the four altars of science, Earth, Air, Fire and Water. An assassin, working for the Illuminati, has captured four cardinals, and murders each, painfully. Robert and Vittoria also are searching for a new very destructive weapon that could kill millions.', '', 'Tom Hanks, Ewan McGregor, Ayelet Zurer, Stellan Skarsgrd', 'http://ia.media-imdb.com/images/M/MV5BMjEzNzM2MjgxMF5BMl5BanBnXkFtZTcwNTQ1MTM0Mg@@._V1_SX300.jpg', '0', '0', '0', '0');
