INSERT INTO `title` VALUES ('442', 'Coraline', 'Coraline', '2', 'Animation, Fantasy', '2009', 'http://www.imdb.com/title/tt0115102/?ref_=fn_al_tt_1', 'i:\\filmovi\\backup.cor.720p', 'When Coraline moves to an old house, she feels bored and neglected by her parents. She finds a hidden door with a bricked up passage. During the night, she crosses the passage and finds a parallel world where everybody has buttons instead of eyes, with caring parents and all her dreams coming true. When the Other Mother invites Coraline to stay in her world forever, the girl refuses and finds that the alternate reality where she is trapped is only a trick to lure her.', '720p', 'Dakota Fanning, Teri Hatcher, Jennifer Saunders, Dawn French', 'http://ia.media-imdb.com/images/M/MV5BMzQxNjM5NzkxNV5BMl5BanBnXkFtZTcwMzg5NDMwMg@@._V1_SX300.jpg', '0', '0', '0', '0');
