INSERT INTO `title` VALUES ('797', 'Transformers: Revenge of the Fallen', 'transformers revenge of the fallen', '1', 'Action, Adventure,SciFi', '2009', 'http://www.imdb.com/title/tt1055369/?ref_=fn_al_tt_1', 'i:\\filmovi i serije\\transformers revenge of the fallen imax edition (2009)', 'Sam Witwicky leaves the Autobots behind for a normal life. But when his mind is filled with cryptic symbols, the Decepticons target him and he is dragged back into the Transformers\' war.', '', 'Shia LaBeouf, Megan Fox, Josh Duhamel, Tyrese Gibson', 'http://ia.media-imdb.com/images/M/MV5BNjk4OTczOTk0NF5BMl5BanBnXkFtZTcwNjQ0NzMzMw@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('798', 'Would You Rather', 'would you rather', '1', 'Horror, Thriller', '2012', 'http://www.imdb.com/title/tt1999995/?ref_=fn_al_tt_1', 'i:\\filmovi i serije\\would.you.rather.2012.bdrip.ac3-5.1.xvid-axed', 'Desperate to help her ailing brother, a young woman unknowingly agrees to compete in a deadly game of \"Would You Rather,\" hosted by a sadistic aristocrat.', '', 'Brittany Snow, Jeffrey Combs, Jonny Coyne, Lawrence Gilliard Jr.', 'http://ia.media-imdb.com/images/M/MV5BNTI1ODY3MTQwNl5BMl5BanBnXkFtZTcwMjU5MjMxOQ@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('800', 'Horrible Bosses', 'horrible bosses', '1', 'Comedy, Crime', '2011', 'http://www.imdb.com/title/tt1499658/?ref_=fn_al_tt_1', 'i:\\filmovi i serije\\horrible bosses (2011)', 'Three friends conspire to murder their awful bosses when they realize they are standing in the way of their happiness.', '', 'Jason Bateman, Steve Wiebe, Kevin Spacey, Charlie Day', 'http://ia.media-imdb.com/images/M/MV5BNzYxNDI5Njc5NF5BMl5BanBnXkFtZTcwMDUxODE1NQ@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('801', 'Horrible Bosses 2', 'horrible bosses 2', '1', 'Comedy, Crime', '2014', 'http://www.imdb.com/title/tt2170439/?ref_=fn_al_tt_1', 'i:\\filmovi i serije\\horrible bosses 2 (2014) [1080p]', 'Dale, Kurt and Nick decide to start their own business but things don\'t go as planned because of a slick investor, prompting the trio to pull off a harebrained and misguided kidnapping scheme.', '1080p', 'Jason Bateman, Jason Sudeikis, Charlie Day, Jennifer Aniston', 'http://ia.media-imdb.com/images/M/MV5BNzU4OTEzNzAwN15BMl5BanBnXkFtZTgwMTgwODAwMzE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('802', 'Jupiter Ascending', 'jupiter ascending', '1', 'Action, Adventure,SciFi', '2015', 'http://www.imdb.com/title/tt1617661/?ref_=fn_al_tt_1', 'i:\\filmovi i serije\\jupiter ascending 2015 hqc@m mp4 murd3r', 'A young woman discovers her destiny as an heiress of intergalactic nobility and must fight to protect the inhabitants of Earth from an ancient and destructive industry.', '', 'Mila Kunis, Channing Tatum, Sean Bean, Eddie Redmayne', 'http://ia.media-imdb.com/images/M/MV5BMTQyNzk2MjA2NF5BMl5BanBnXkFtZTgwMjEwNzk3MjE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('803', 'Star Trek The Final Frontier', 'Star Trek The Final Frontier', '1', 'Action, Adventure,SciFi', '1989', 'http://www.imdb.com/title/tt0098382/?ref_=fn_al_tt_1', 'i:\\filmovi i serije\\star trek the final frontier (1989)', 'Captain Kirk and his crew must deal with Mr. Spock\'s long-lost half-brother who hijacks the Enterprise for an obsessive search for God at the center of the galaxy.', '', 'William Shatner, Leonard Nimoy, DeForest Kelley, James Doohan', 'http://ia.media-imdb.com/images/M/MV5BMjI2OTExMDQxN15BMl5BanBnXkFtZTcwOTEyNDI4OA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('804', 'Star Trek: The Motion Picture', 'star trek the motion picture', '1', 'Adventure, Mystery,SciFi', '1979', 'http://www.imdb.com/title/tt0079945/?ref_=fn_al_tt_1', 'i:\\filmovi i serije\\star trek the motion picture (1979)', 'When an alien spacecraft of enormous power is spotted approaching Earth, Admiral Kirk resumes command of the Starship Enterprise in order to intercept, examine and hopefully stop the intruder.', '', 'William Shatner, Leonard Nimoy, DeForest Kelley, James Doohan', 'http://ia.media-imdb.com/images/M/MV5BNzE4MTY1MTMyN15BMl5BanBnXkFtZTcwMzk5MzI4OA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('805', 'Star trek The Search for Spock', 'Star trek The Search for Spock', '1', 'Action, Adventure,SciFi', '1984', 'http://www.imdb.com/title/tt0088170/?ref_=fn_al_tt_1', 'i:\\filmovi i serije\\star trek the search for spock (1984)', 'Admiral Kirk and his bridge crew risk their careers stealing the decommissioned Enterprise to return to the restricted Genesis planet to recover Spock\'s body.', '', 'William Shatner, Leonard Nimoy, DeForest Kelley, James Doohan', 'http://ia.media-imdb.com/images/M/MV5BMTc5NDY1OTU0Ml5BMl5BanBnXkFtZTcwNDIwNDI4OA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('806', 'Star Trek The Undiscovered Country', 'Star Trek The Undiscovered Country', '1', 'Action, Adventure, Mystery', '1991', 'http://www.imdb.com/title/tt0152592/?ref_=fn_al_tt_1', 'i:\\filmovi i serije\\star trek the undiscovered country (1991)', 'After an explosion on their moon, the Klingons have an estimated 50 years before their ozone layer is completely depleted, and they all die. They have only one choice - to make peace with the Federation, which will mean an end to 70 years of conflict. Captain James T. Kirk and crew are called upon to help in the negotiations because of their \"experience\" with the Klingon race. Peace talks don\'t quite go to plan, and eventually Kirk and McCoy are tried and convicted of assassination, and sent to Rura Penthe, a snowy hard-labor prison camp. Will they manage to escape? And will there ever be peace with the Klingons?', '', 'William Shatner, Leonard Nimoy, DeForest Kelley, James Doohan', 'http://ia.media-imdb.com/images/M/MV5BMTkyODE4MDIxNV5BMl5BanBnXkFtZTcwNzYxNDI4OA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('807', 'Star Trek The Voyage Home', 'Star Trek The Voyage Home', '1', 'Action, Adventure, Comedy', '1986', 'http://www.imdb.com/title/tt1909345/?ref_=fn_al_tt_1', 'i:\\filmovi i serije\\star trek the voyage home (1986)', 'James T. Kirk who after rescuing Mr. Spock and bringing him to Vulcan where he is fully restored, is now the most hated man in the universe, because he disobeyed his superiors, killed a Klingon crew and took their ship. After three months on Vulcan, Kirk decides to return to Earth to face the consequences of his actions along with his crew who aided him. Also accompanying them is Mr. Spock, who is still trying to understand his human side. What they don\'t know is that an alien probe approaches Earth and is emitting a signal that nullifies all power systems. And it is now vaporizing the planet\'s oceans covering the planet in a cloud that covers the earth cutting them off from the sun - the planet\'s main source of energy. The President of the Federation sends a transmission telling everyone about what is happening and to stay away from Earth. Kirk upon hearing it, checks out the probe\'s transmission and Spock postulates that the alien is not hostile merely unaware that its transmissions are disruptive. Spock thinks it\'s trying to communicate with another species other than man. And upon analyzing it, Spock learns that the probe is sending the songs of whales, specifically humpback whales. The only problem is that the species has been extinct for two centuries. With little choice, Kirk decides to get some humpback whales from the only place they can from Earth in the past so that they can communicate with the probe. So they travel through time and arrive in the late 20th century. And they discover a pair of humpback whales in San Francisco. So Kirk and Spock set out to find them. While Scotty, McCoy and Sulu try to find the materials they need to make a whale tank. And also the ship\'s dilithium crystals are failing. So Uhura and Chekov try to find a nuclear reactor so that they can drain some radiation which they hope can restore the ship\'s power. And they have to contend with the ways of the 20th century.', '', 'William Shatner, Leonard Nimoy, DeForest Kelley, James Doohan', 'http://ia.media-imdb.com/images/M/MV5BMjEzOTk1ODU1Ml5BMl5BanBnXkFtZTcwODEwNDI4OA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('808', 'Star Trek The Wrath of Khan', 'Star Trek The Wrath of Khan', '1', 'Action, Adventure, Drama', '1982', 'http://www.imdb.com/title/tt0084726/?ref_=fn_al_tt_1', 'i:\\filmovi i serije\\star trek the wrath of khan (1982)', 'With the assistance of the Enterprise crew, Admiral Kirk must stop an old nemesis, Khan Noonien Singh, from using his son\'s life-generating device, the Genesis Device, as the ultimate weapon.', '', 'William Shatner, Leonard Nimoy, DeForest Kelley, James Doohan', 'http://ia.media-imdb.com/images/M/MV5BMTcwNjc5NjA4N15BMl5BanBnXkFtZTcwNDk5MzI4OA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('809', 'Star Wars: Episode I - The Phantom Menace', 'star wars episode I the phantom menace', '1', 'Action, Adventure, Fantasy', '1999', 'http://www.imdb.com/title/tt0120915/?ref_=fn_al_tt_1', 'i:\\filmovi i serije\\star.wars.episode.i.the.phantom.menace.1999', 'Two Jedi Knights escape a hostile blockade to find allies and come across a young boy who may bring balance to the Force, but the long dormant Sith resurface to reclaim their old glory.', '', 'Liam Neeson, Ewan McGregor, Natalie Portman, Jake Lloyd', 'http://ia.media-imdb.com/images/M/MV5BMTQ4NjEwNDA2Nl5BMl5BanBnXkFtZTcwNDUyNDQzNw@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('810', 'Star Wars: Episode II - Attack of the Clones', 'star wars episode II attack of the clones', '1', 'Action, Adventure, Fantasy', '2002', 'http://www.imdb.com/title/tt0121765/?ref_=fn_al_tt_1', 'i:\\filmovi i serije\\star.wars.episode.ii.attack.of.the.clones.2002', 'Ten years after initially meeting, Anakin Skywalker shares a forbidden romance with Padm, while Obi-Wan investigates an assassination attempt on the Senator and discovers a secret clone army crafted for the Jedi.', '', 'Ewan McGregor, Natalie Portman, Hayden Christensen, Christopher Lee', 'http://ia.media-imdb.com/images/M/MV5BMTY5MjI5NTIwNl5BMl5BanBnXkFtZTYwMTM1Njg2._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('811', 'Star Wars: Episode III - Revenge of the Sith', 'star wars episode III revenge of the sith', '1', 'Action, Adventure, Fantasy', '2005', 'http://www.imdb.com/title/tt0121766/?ref_=fn_al_tt_1', 'i:\\filmovi i serije\\star.wars.episode.iii.revenge.of.the.sith.2005', 'As the Clone Wars near an end, the Sith Lord Darth Sidious steps out of the shadows, at which time Anakin succumbs to his emotions, becoming Darth Vader and putting his relationships with Obi-Wan and Padme at risk.', '', 'Ewan McGregor, Natalie Portman, Hayden Christensen, Ian McDiarmid', 'http://ia.media-imdb.com/images/M/MV5BNTc4MTc3NTQ5OF5BMl5BanBnXkFtZTcwOTg0NjI4NA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('812', 'Star Wars: Episode IV - A New Hope', 'star wars episode IV a new hope', '1', 'Action, Adventure, Fantasy', '1977', 'http://www.imdb.com/title/tt0076759/?ref_=fn_al_tt_1', 'i:\\filmovi i serije\\star.wars.episode.iv.a.new.hope.1977', 'Luke Skywalker joins forces with a Jedi Knight, a cocky pilot, a wookiee and two droids to save the universe from the Empire\'s world-destroying battle-station, while also attempting to rescue Princess Leia from the evil Darth Vader.', '', 'Mark Hamill, Harrison Ford, Carrie Fisher, Peter Cushing', 'http://ia.media-imdb.com/images/M/MV5BMTU4NTczODkwM15BMl5BanBnXkFtZTcwMzEyMTIyMw@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('813', 'Star Wars: Episode V - The Empire Strikes Back', 'star wars episode V the empire strikes back', '1', 'Action, Adventure, Fantasy', '1980', 'http://www.imdb.com/title/tt0080684/?ref_=fn_al_tt_1', 'i:\\filmovi i serije\\star.wars.episode.v.the.empire.strikes.back.1980', 'After the rebels have been brutally overpowered by the Empire on their newly established base, Luke Skywalker takes advanced Jedi training with Master Yoda, while his friends are pursued by Darth Vader as part of his plan to capture Luke.', '', 'Mark Hamill, Harrison Ford, Carrie Fisher, Billy Dee Williams', 'http://ia.media-imdb.com/images/M/MV5BMjE2MzQwMTgxN15BMl5BanBnXkFtZTcwMDQzNjk2OQ@@._V1_SX300.jpg', '0', '0', '0', '0');
