INSERT INTO `title` VALUES ('815', 'The Dictator', 'the dictator', '1', 'Comedy', '2012', 'http://www.imdb.com/title/tt1645170/?ref_=fn_al_tt_1', 'i:\\filmovi i serije\\the.dictator.2012.unrated.1080p.bluray.x264-amiable', 'The heroic story of a dictator who risks his life to ensure that democracy would never come to the country he so lovingly oppressed.', '1080p', 'Sacha Baron Cohen, Sayed Badreya, Rocky Citron, Liam Campora', 'http://ia.media-imdb.com/images/M/MV5BMjA4NjEyOTc4NV5BMl5BanBnXkFtZTcwODYzMjk2Nw@@._V1_SX300.jpg', '0', '0', '0', '0');
