INSERT INTO `title` VALUES ('863', 'Atomic bomberman', 'Atomic bomberman', '4', 'Action, Game', '1982', 'http://www.imdb.com/title/tt0083590/?ref_=fn_al_tt_1', 'f:\\igre\\atomic bomberman', 'Atomic Bomberman is a game by Interplay for the PC that was released in 1997. It was the first original Bomberman game to be developed for Windows, and the second game of the series made for the PC, following 1992\'s Bomberman.The game is relatively unusual in the Bomberman series, as it was officially licensed from Hudson Soft and developed by an American team. Most titles in the series were developed in Japan. It has a different look and feel compared to other Bomberman titles as a result (despite basic gameplay being unchanged), using pre-rendered 3D characters and backgrounds as opposed to hand-drawn animated sprites, techno-inspired background music and the extensive use of voice samples during gameplay. The voice clips are by well-known voice actors Charlie Adler and Billy West.', '', '', 'https://upload.wikimedia.org/wikipedia/en/thumb/2/2c/Abombercov.jpg/250px-Abombercov.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('864', 'Batman: Arkham City', 'batman arkham city', '4', 'Action, Crime, Fantasy', '2011', 'http://www.imdb.com/title/tt1568322/?ref_=fn_al_tt_1', 'f:\\igre\\batman arkham city', 'When part of Gotham is turned into a private reserve for criminals, all hell is sure to break loose, and the Dark Knight is the only one who can stop it.', '', 'Kevin Conroy, Grey Griffin, Troy Baker, Kimberly Brooks', 'http://ia.media-imdb.com/images/M/MV5BNDE4NzIwNzA0OF5BMl5BanBnXkFtZTcwMzk4MzU5Ng@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('865', 'Battlefield 3', 'battlefield 3', '4', 'Action, War', '2011', 'http://www.imdb.com/title/tt1954263/?ref_=fn_al_tt_1', 'f:\\igre\\battlefield 3', 'In Battlefield 3, players step into the role of the elite U.S. Marines. They will experience heart-pounding single player missions and competitive multiplayer action ranging across diverse ...', '', 'Gideon Emery, Glenn Morshower, Thor Edgell, Mark Ivanir', 'http://ia.media-imdb.com/images/M/MV5BMjI0ODU0ODU4Nl5BMl5BanBnXkFtZTcwOTc1OTM3Nw@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('866', 'BioShock Infinite', 'bioshock infinite', '4', 'Action, Adventure,SciFi', '2013', 'http://www.imdb.com/title/tt1712064/?ref_=fn_al_tt_1', 'f:\\igre\\bioshock infinite', 'A man is sent to the flying city of Columbia to find a missing girl. However, upon arrival he discovers that the city, its people, and his objective are all not what they seem.', '', 'Troy Baker, Courtnee Draper, Kiff VandenHeuvel, Laura Bailey', 'http://ia.media-imdb.com/images/M/MV5BMzc0MTg5ODMwNl5BMl5BanBnXkFtZTcwOTYwMjM5OA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('867', 'Call of Duty 2', 'call of duty 2', '4', 'Action, War', '2005', 'http://www.imdb.com/title/tt0469287/?ref_=fn_al_tt_1', 'f:\\igre\\call of duty 2', 'Infinity Ward returns with more cinematic intensity and chaos than ever before, in World War II\'s most climactic battles. Join your squad and choose your Single Player missions, or go on-line for intense Multiplayer action.', '', 'Michael Cudlitz, Rick Gomez, Frank John Hughes, James Madio', 'http://ia.media-imdb.com/images/M/MV5BMzgyMzczMTQzNF5BMl5BanBnXkFtZTgwMjM4MTk4MDE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('868', 'Call of Duty: Modern Warfare 2', 'call of duty modern warfare', '4', 'Action, Adventure, War', '2009', 'http://www.imdb.com/title/tt1450746/?ref_=fn_al_tt_1', 'f:\\igre\\call of duty modern warfare', 'A massacre at a Russian airport leads to a war between Russia and the United States. Meanwhile, a Task Force is sent to find the perpetrators and bring the bloodshed to an end.', '', 'Lance Henriksen, Keith David, Barry Pepper, Kevin McKidd', 'http://ia.media-imdb.com/images/M/MV5BNTY3ODg4MDI3OF5BMl5BanBnXkFtZTcwNDE2Mjg2NA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('869', 'Crysis', 'crysis', '4', 'Action,SciFi, Thriller', '2007', 'http://www.imdb.com/title/tt0954921/?ref_=fn_al_tt_1', 'f:\\igre\\crysis 1', 'Sent in to investigate an alien meteor crash, Nomad must fight through the North Korean Army which has also arrived, only to discover North Korea is the least of their worries.', '', 'Claudia Black, Andr Sogliuzzo, Kristy Swanson, Lahmard J. Tate', 'http://ia.media-imdb.com/images/M/MV5BNzMwNjE2MjI1NV5BMl5BanBnXkFtZTgwNjgxOTM5MDE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('870', 'Crysis 3', 'crysis 3', '4', 'Action,SciFi', '2013', 'http://www.imdb.com/title/tt2374911/?ref_=fn_al_tt_1', 'f:\\igre\\crysis 3', 'Prophet is forced to save New York City from CELL after the alien invasion in Crysis 2 (2006).', '', 'James Vincent Meredith, David Kennedy, Kosha Engler, Wolf Kahler', 'http://ia.media-imdb.com/images/M/MV5BMjM1MDY0MzY3N15BMl5BanBnXkFtZTgwNzE4MTk4MDE@._V1_SX300.jpg', '0', '0', '1', '0');
INSERT INTO `title` VALUES ('871', 'Crysis warhead', 'Crysis warhead', '4', 'Action,SciFi', '2008', 'http://www.imdb.com/title/tt1305015/?ref_=fn_al_tt_1', 'f:\\igre\\crysis warhead', 'N/A', '', 'Sean Chapman, Kal Weber, John Schwab, Kathryn Akin', 'https://upload.wikimedia.org/wikipedia/en/thumb/2/20/Crysis_Warhead_Boxart.jpg/256px-Crysis_Warhead_Boxart.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('872', 'Crysis 2', 'Crysis 2', '4', 'Action,SciFi, Thriller', '2011', 'http://www.imdb.com/title/tt1684551/?ref_=fn_al_tt_1', 'f:\\igre\\Crysis 2', 'Set 3 years after the original game. Fight the aliens, following the protagonist in a new type of jungle; New York, the urban jungle.', '', 'Janis Ahern, Joey Ansah, Paul Birchard, Peter Brooke', 'http://ia.media-imdb.com/images/M/MV5BMTQ4OTk5OTQ2Ml5BMl5BanBnXkFtZTgwMDEyNTMyMTE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('873', 'Dead Space 2', 'Dead Space 2', '4', 'Action, Horror,SciFi', '2011', 'http://www.imdb.com/title/tt1697062/?ref_=fn_al_tt_1', 'f:\\igre\\Dead Space 2', '3 years after the events of Dead Space, Engineer Isaac Clarke awakens on an orbiting space station with no memory of the past three years of his life. But when another Necromorph outbreak occurs, Isaac must find out who to trust in order to stop it while finding out how to remove a code from within his brain that is slowly killing him.', 'Insert quality...', 'Gunner Wright, Tanya Clarke, Sonita Henry, Curt Cornelius', 'http://ia.media-imdb.com/images/M/MV5BMTYxMjAyNzcwMl5BMl5BanBnXkFtZTgwODQyMTg5MDE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('874', 'Deus Ex: Human Revolution', 'deus ex human revolution', '4', 'Action,SciFi', '2011', 'http://www.imdb.com/title/tt1319708/?ref_=fn_al_tt_1', 'f:\\igre\\deus ex human revolution', 'When a black ops team breaks in and kills the scientists Adam Jensen was hired to protect, everything he thought he knew about his job changes. And someone is working very hard to ensure ...', '', 'Elias Toufexis, Stephen Shellen, Andreas Apergis, Michelle Boback', 'http://ia.media-imdb.com/images/M/MV5BMTY3ODM4NDkyNl5BMl5BanBnXkFtZTgwNjgwNzg2MDE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('875', 'Diablo III', 'Diablo III', '4', 'Action, Fantasy, Horror', '2012', 'http://www.imdb.com/title/tt2194386/?ref_=fn_al_tt_1', 'f:\\igre\\diablo 3', 'The game takes place in Sanctuary, the dark fantasy world of the Diablo series, twenty years after the events of Diablo II. Deckard Cain and his niece Leah are in Tristram Cathedral investigating ancient texts regarding an ominous prophecy. A mysterious star falling from the sky strikes the Cathedral, creating a deep crater into which Deckard Cain disappears.', '', 'Athena Karkanis, Dorian Harewood, Anna Graves, Robin Atkin Downes', 'http://ia.media-imdb.com/images/M/MV5BMTg2NDA4NTM0OV5BMl5BanBnXkFtZTgwMDg2NzE2MDE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('876', 'Dragon Age: Inquisition', 'Dragon Age: Inquisition', '4', 'Action, Adventure, Fantasy', '2014', 'http://www.imdb.com/title/tt1541718/?ref_=fn_al_tt_1', 'f:\\igre\\dragon age 2', 'A cataclysmic event plunges the land of Thedas into turmoil. Dragons darken the sky, casting a shadow of terror over a once-peaceful kingdom. Mages break into all-out war against the oppressive Templars. Nations rise against one another. It falls to you and your party of legendary heroes to restore order as you lead the Inquisition, hunting down the agents of chaos. Bonds will form - and some will break - as the campaign for truth takes its toll.', '', 'Harry Hadden-Paton, Alix Wilton Regan, Jon Curry, Sumalee Montano', 'http://oyster.ignimgs.com/mediawiki/apis.ign.com/dragon-age-3/thumb/5/5a/DragonAge_Cover.jpg/468px-DragonAge_Cover.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('877', 'Dragon Age: Origins', 'dragon age', '4', 'Action, Adventure, Fantasy', '2009', 'http://www.imdb.com/title/tt1541718/?ref_=fn_al_tt_1', 'f:\\igre\\dragon age ultimate edition', 'After 400 years since the last Blight, a new Archdemon seeks to destroy the land of Ferelden. It is up to the player - as one remaining legendary Grey Wardens - to unite the divided armies of Ferelden and save humanity.', '', 'Steve Valentine, Peter Renaday, Kate Mulgrew, Tim Curry', 'http://ia.media-imdb.com/images/M/MV5BMTM2NzI2MjYyM15BMl5BanBnXkFtZTcwMjIzNTQwNA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('878', 'Fallout 3', 'fallout 3', '4', 'Action, Adventure,SciFi', '2008', 'http://www.imdb.com/title/tt1073664/?ref_=fn_al_tt_1', 'f:\\igre\\fallout 3', 'Centuries following nuclear war, a teen leaves the safety of his underground vault in order to find his father, who left in hopes of creating a water purifier.', '', 'Liam Neeson, Malcolm McDowell, Ron Perlman, Odette Annable', 'http://ia.media-imdb.com/images/M/MV5BMzM3ODA4MTg2OV5BMl5BanBnXkFtZTgwOTQwMzc1MDE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('879', 'Far Cry 3', 'far cry 3', '4', 'Action, Thriller', '2012', 'http://www.imdb.com/title/tt2321297/?ref_=fn_al_tt_1', 'f:\\igre\\far cry 3', 'While skydiving, Jason Brody and his friends land on an island overrun by pirates. Jason is befriended by the Rakyat, a resistance movement. He is torn between fighting for the Rakyat resistance and the task of rescuing his friends.', '', 'Lane Edwards, Alex Harrouch, Mylne Dinh-Robic, Kristian Hodko', 'http://ia.media-imdb.com/images/M/MV5BMTU2ODk5Nzg4MV5BMl5BanBnXkFtZTgwNzYwOTU1MDE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('881', 'Heroes of Might and Magic III: Armageddon\'s Blade', 'Heroes of Might and Magic III: Armageddon\'s Blade', '4', 'Action, Adventure, Fantasy', '1999', 'http://www.imdb.com/title/tt0813715/?ref_=fn_al_tt_1', 'f:\\igre\\heroes iii', 'N/A', '', 'Catherine Battistone, Richard Epcar', 'https://upload.wikimedia.org/wikipedia/en/thumb/9/9b/Homm3boxart.jpg/256px-Homm3boxart.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('882', 'Heroes vi', 'Heroes vi', '4', 'Fantasy', '2011', 'http://www.imdb.com/title/tt1849780/?ref_=fn_al_tt_1', 'f:\\igre\\heroes vi', 'N/A', '', 'Ben Diskin, Christopher L. Parson, Christine Lakin, Julie Nathanson', 'https://upload.wikimedia.org/wikipedia/en/2/2f/Might_and_Magic_Heroes_VI_Cover.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('883', 'Hitman: Absolution', 'Hitman: Absolution', '4', 'Action, Comedy, Crime', '2012', 'http://www.imdb.com/title/tt2538002/?ref_=fn_al_tt_1', 'f:\\igre\\hitman absolution', 'After assassinating his former handler, Diana, Agent 47 goes on a mission on her request to track down a young girl named Victoria. Meanwhile, his own employers hunt him and an arms manufacturer, Blake Dexter, pursues Victoria as well.', '', 'David Bateson, Jonathan Adams, Adrienne Barbeau, Steven Bauer', 'http://ia.media-imdb.com/images/M/MV5BMjAwOTM0NzA5M15BMl5BanBnXkFtZTgwMjA0NjQ2MDE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('884', 'Mafia II', 'Mafia II', '4', 'Action, Crime, Drama', '2010', 'http://www.imdb.com/title/tt0159795/?ref_=fn_al_tt_1', 'f:\\igre\\mafia 2', 'The storyline for Mafia II is a gritty drama and chronicles the rise of Vito Scaletta, the son of Sicilian immigrants. As the game progresses, Vito joins the Falcone crime family and becomes \"a made man\" along with his best friend Joe Barbaro.', '', 'Rick Pasqualone, Robert Costanzo, Ray Iannicelli, Roger Rose', 'http://ia.media-imdb.com/images/M/MV5BMTQwMTkzMjM4M15BMl5BanBnXkFtZTcwOTIwMjM5OA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('885', 'Mass Effect 3', 'mass effect 3', '4', 'Action,SciFi', '2012', 'http://www.imdb.com/title/tt1839558/?ref_=fn_al_tt_1', 'f:\\igre\\mass effect 3', 'Earth is under attack by a monstrous race of gigantic living ships known as the Reapers. Even if Commander Shepard could unite all surviving species in the universe, only a miracle can help. Then again, Shepard did come back from the dead.', '', 'Jennifer Hale, Mark Meer, Raphael Sbarge, Jessica Chobot', 'http://ia.media-imdb.com/images/M/MV5BMTM2OTQ5NTU0Ml5BMl5BanBnXkFtZTcwMjc5MTU0Nw@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('886', 'Max Payne 3', 'Max Payne 3', '4', 'Action, Crime, Drama', '2012', 'http://www.imdb.com/title/tt1407064/?ref_=fn_al_tt_1', 'f:\\igre\\Max Payne 3', 'Nine years after the events of Max Payne 2: The Fall of Max Payne (2003), Max finds himself living a degenerative lifestyle, addicted to painkillers and alcohol in the city of Sao Paulo, Brazil, while trying to forget the past that haunts him. Employed by real estate mogul Rodrigo Branco, Max works in private security, protecting the wealthy Branco family. But as things go wrong and Rodrigo\'s wife Fabiana is kidnapped, Max is forced into a deadly new conflict, while relying on the abilities he attained from the experiences of the past he left behind.', '', 'James McCaffrey, Julian Dean, Frank Rodriguez, Addison LeMay', 'http://ia.media-imdb.com/images/M/MV5BMjMxMjY1OTAyOF5BMl5BanBnXkFtZTcwNTMxMjU2Ng@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('887', 'Metro 2033', 'metro 2033', '4', 'Action, Adventure, Horror', '2010', 'http://www.imdb.com/title/tt1675746/?ref_=fn_al_tt_1', 'f:\\igre\\metro 2033', 'Man has fallen, struggling to survive within Moscow\'s metro. In the face of a new mysterious threat young Artyom must leave his home station for the first time, making a dangerous journey to the legendary Polis to enlist their help.', '', 'Nina Avetisova, Steve Blum, Carolyn Hennesy, Sven Holmberg', 'http://ia.media-imdb.com/images/M/MV5BOTk3Mzg5OTU5Nl5BMl5BanBnXkFtZTgwNjAyNTMyMTE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('888', 'Path of Exile', 'Path of Exile', '4', 'Action', '2012', 'http://www.imdb.com/title/tt0451118/?ref_=fn_al_tt_1', 'f:\\igre\\path of exile', 'Path of Exile is an online Action RPG set in the dark fantasy world of Wraeclast. It is designed around a strong barter-based online item economy, deep character customisation, competitive PvP and ladder races. The game is completely free and will never be \"pay to win\".', '', 'Elliot Christensen-Yule, Chris Wilson, Sophie Hambleton, Kevin Harty', 'http://www.diabloii.net/gallery/data/578/medium/PathofExileLogo.png', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('889', 'Quake collection', 'Quake collection', '4', 'Action, Adventure, Horror', '1996', 'http://www.imdb.com/title/tt0152116/?ref_=fn_al_tt_1', 'f:\\igre\\quake ultimate collection', 'Mankind discovers the secret of \'slipgates\' called teleporters. However, they\'re misused by some strange force code-named \'Quake\', which uses the slipgates to send hordes of warriors to ...', '', '', 'http://images.alphacoders.com/857/8571.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('890', 'Red faction', 'Red faction', '4', 'Animation, Action,SciFi', '2001', 'http://www.imdb.com/title/tt0280064/?ref_=fn_al_tt_1', 'f:\\igre\\red faction guerilla', 'Rebels band together to bring down a power-hungry corporation controlling the world government with a violent iron-fist.', '', '', 'https://upload.wikimedia.org/wikipedia/en/4/4b/Red_Faction_Guerrilla_Cover.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('891', 'Resident Evil 4', 'resident evil 4', '4', 'Action, Adventure, Crime', '2005', 'http://www.imdb.com/title/tt0397042/?ref_=fn_al_tt_1', 'f:\\igre\\resident evil 4', 'Leon S. Kennedy, now a federal agent, is hired to rescue the president\'s daughter from a sinister cult.', '', 'Paul Mercier, Carolyn Lawrence, Rino Romano, Salli Saffioti', 'http://ia.media-imdb.com/images/M/MV5BMTU1NjY2MDM4Nl5BMl5BanBnXkFtZTgwMzk0MTU3MDE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('892', 'Resident Evil 5', 'resident evil 5', '4', 'Action, Adventure, Drama', '2009', 'http://www.imdb.com/title/tt0473298/?ref_=fn_al_tt_1', 'f:\\igre\\resident evil 5', 'Sent in by the BSAA, Chris Redfield has a new mission. It takes him into South Africa where he encounters a new horror and relives an old past.', '', 'Roger Craig Smith, Eva La Dare, D.C. Douglas, Patricia Ja Lee', 'http://ia.media-imdb.com/images/M/MV5BMTk3MDMzNzMxMV5BMl5BanBnXkFtZTcwNDYxNTMxNg@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('893', 'Resident Evil 6', 'resident evil 6', '4', 'Action, Adventure, Horror', '2012', 'http://www.imdb.com/title/tt2193031/?ref_=fn_al_tt_1', 'f:\\igre\\resident evil 6', 'The war on bio-terrorism continues as Chris Redfield, Leon Kennedy, and other famous Resident Evil stalwarts battle a seemingly familiar adversary. However, as these veterans of survival ...', '', 'Matthew Mercer, Roger Craig Smith, Troy Baker, Courtenay Taylor', 'http://ia.media-imdb.com/images/M/MV5BMjI2MTEzMTQ5Ml5BMl5BanBnXkFtZTgwMzMwMDA3MDE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('894', 'Revolt', 'Revolt', '4', 'Action', '1997', 'http://www.imdb.com/title/tt3722614/?ref_=fn_al_tt_1', 'f:\\igre\\revolt', 'Fancy tearing up the track and terrorising the neighbours cat? In Re-Volt you will drive various RC cars around courses loosely modelled on the real world, but without all that pesky realism or kill-joy authority figures telling you that you cant race your toy cars through supermarkets or city streets. The game was well received on release and despite it having been out of print for several years it still has a small but dedicated fan following online, making it well worth a spin if you can find a copy.', '', '', 'http://www.play-old-pc-games.com/wp-content/uploads/2015/05/revolt-cover.jpg', '0', '0', '0', '1');
INSERT INTO `title` VALUES ('895', 'South Park: The Stick of Truth', 'South Park: The Stick of Truth', '4', 'Animation, Adventure, Comedy', '2014', 'http://www.imdb.com/title/tt2133326/?ref_=fn_al_tt_1', 'f:\\igre\\South Park  The Stick of Truth', 'South Park is torn by war of two teams of kids protecting a magic stick. Just when they thought it would be simple, a new threat is aiming at South Park. Their only hope is the new kid \"You\".', 'Insert quality...', 'Trey Parker, Matt Stone, Mona Marshall, April Stewart', 'http://ia.media-imdb.com/images/M/MV5BMTQ2MzM1MTM3NF5BMl5BanBnXkFtZTgwMzQ4NzIxMTE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('896', 'Star Wars: The Old Republic', 'star wars the old republic', '4', 'Action, Adventure, Fantasy', '2011', 'http://www.imdb.com/title/tt1320395/?ref_=fn_al_tt_1', 'f:\\igre\\star wars the old republic', 'Set long before the Star Wars films, the Sith Empire returns to the galaxy to begin a war with the Galactic Republic. After some brutal battles, both sides stop fighting each other, but the...', '', 'Tom Spackman, Grey Griffin, Bertie Carvel, Jo Wyatt', 'http://ia.media-imdb.com/images/M/MV5BMjI5MTQxMzgyMF5BMl5BanBnXkFtZTcwODc2NDUwNw@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('897', 'StarCraft II: Wings of Liberty', 'starcraft ii wings of liberty', '4', 'Action,SciFi', '2010', 'http://www.imdb.com/title/tt1037854/?ref_=fn_al_tt_1', 'f:\\igre\\starcraft ii wings of liberty', 'Four years after the events of StarCraft: Brood War, Jim Raynor fights against the Dominion and begins a search for artifacts when at the same time zerg attack once again.', '', 'James Harper, Dave Fennoy, Robert Clotworthy, Brian Bloom', 'http://ia.media-imdb.com/images/M/MV5BNDczMTIzODU5Nl5BMl5BanBnXkFtZTgwNzgwNjUwMTE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('898', 'The Elder Scrolls V: Skyrim', 'the elder scrolls v skyrim', '4', 'Action, Adventure, Drama', '2011', 'http://www.imdb.com/title/tt1814884/?ref_=fn_al_tt_1', 'f:\\igre\\the elder scrolls v skyrim', 'After escaping from execution, one of the last living DragonBorn must grow in strength and power to defeat the dragons that have begun to once again plague the land of Skyrim.', '', 'Max von Sydow, Christopher Plummer, Joan Allen, Michael Hogan', 'http://ia.media-imdb.com/images/M/MV5BMTU3OTY0MTA2NF5BMl5BanBnXkFtZTgwNDczMDU0MDE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('899', 'The Incredible Adventures of Van Helsing', 'The Incredible Adventures of Van Helsing', '4', 'N/A', '2013', 'http://www.imdb.com/title/tt0326969/?ref_=fn_al_tt_1', 'f:\\igre\\the incredible adventures of van hellsing', 'N/A', '', 'N/A', 'http://static.giantbomb.com/uploads/original/17/171291/2486193-the-incredible-adventures-of-van-helsing_pc_cover.jpg', '0', '0', '0', '1');
INSERT INTO `title` VALUES ('900', 'The Witcher 2: Assassins of Kings', 'the witcher 2 assassins of kings', '4', 'Action, Adventure, Drama', '2011', 'http://www.imdb.com/title/tt1937416/?ref_=fn_al_tt_1', 'f:\\igre\\the witcher 2 assassins of kings', 'Geralt must track down a mysterious kingslayer, who seams to have the powers and skills of a witcher. Did the leaders of a joint rebellion of non-human races, who fight for their freedom, send him, or is there more to this mystery?', '', 'Doug Cockle, Alexander Morton, Antony Byrne, David Annen', 'http://ia.media-imdb.com/images/M/MV5BNzg2NzEyOTQ4N15BMl5BanBnXkFtZTcwNjc2ODEzNw@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('901', 'Tomb Raider', 'tomb raider', '4', 'Action, Adventure, Mystery', '2013', 'http://www.imdb.com/title/tt1797530/?ref_=fn_al_tt_1', 'f:\\igre\\tomb raider 2013', 'Armed with only the raw instincts and physical ability, Tomb Raider delivers an intense and gritty story into the origins of Lara Croft and her ascent from a frightened young woman to a hardened survivor.', '', 'Camilla Luddington, Robin Atkin Downes, Cooper Thornton, Robert Craighead', 'http://ia.media-imdb.com/images/M/MV5BMTExNzE0OTI3NzleQTJeQWpwZ15BbWU3MDY5OTkzODk@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('902', 'Torchlight', 'Torchlight', '4', 'Action', '2009', 'http://www.imdb.com/title/tt1539134/?ref_=fn_al_tt_1', 'f:\\igre\\torchlight 2009', 'Torchlight is a mining town built above a rich vein of Ember, a mysterious ore with the power to imbue items with magical powers. However, it also has the power to corrupt those who use it,...', '', 'Lani Minella, Sam A. Mowry, Eric Newsome, Tim Simmons', 'https://upload.wikimedia.org/wikipedia/en/a/a2/TorchlightRetailBox.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('903', 'The Lord of the Rings: War in the North', 'war in the north', '4', 'Action, Adventure, Fantasy', '2011', 'http://www.imdb.com/title/tt2102446/?ref_=fn_al_tt_1', 'f:\\igre\\war in the north', 'Three heroes come together to defend against a very dark evil brewing in the North.', '', 'Ike Amadi, Laura Bailey, Steve Blum, John Cygan', 'http://ia.media-imdb.com/images/M/MV5BMTk0MzM5ODk0MF5BMl5BanBnXkFtZTgwNjA5MDk4MDE@._V1_SX300.jpg', '0', '0', '0', '0');
