INSERT INTO `title` VALUES ('909', 'L.A. Noire', 'L.A. Noire', '4', 'Action, Crime, Drama', '2011', 'http://www.imdb.com/title/tt2261757/?ref_=fn_al_tt_1', 'e:\\igre\\la noire', 'Amid the post-war boom of Hollywood\'s Golden Age, Cole Phelps is an LAPD detective thrown headfirst into a city drowning in its own success. Corruption is rampant, the drug trade is exploding, and murder rates are at an all-time high. In his fight to climb the ranks and do what\'s right, Phelps must unravel the truth behind a string of arson attacks, racketeering conspiracies and brutal murders, battling the L.A. underworld and even members of his own department to uncover a secret that could shake the city to its rotten core.', '', 'Aaron Staton, Michael McGrady, Adam Harrington, Sean McGowan', 'http://ia.media-imdb.com/images/M/MV5BMTUwMjEzNjE5Ml5BMl5BanBnXkFtZTcwMzI0NTM4NA@@._V1_SX300.jpg', '0', '0', '0', '0');
