INSERT INTO `title` VALUES ('913', 'Grand Theft Auto V', 'Grand Theft Auto V', '4', 'Action, Adventure, Comedy', '2013', 'http://www.imdb.com/title/tt4171058/?ref_=fn_al_tt_1', 'd:\\igre\\gta v', 'Los Santos: a sprawling sun-soaked metropolis full of self-help gurus, starlets and fading celebrities, once the envy of the Western world, now struggling to stay afloat in an era of economic uncertainty and cheap reality TV. Amidst the turmoil, three very different criminals plot their own chances of survival and success: Franklin, a former street gangster, now looking for real opportunities and serious money; Michael, a professional ex-con whose retirement is a lot less rosy than he hoped it would be; and Trevor, a violent maniac driven by the chance of a cheap high and the next big score. Running out of options, the crew risks everything in a series of daring and dangerous heists that could set them up for life.', '', 'Shawn Fonteno, Ned Luke, Steven Ogg, Gerald \'Slink\' Johnson', 'http://ia.media-imdb.com/images/M/MV5BMzQ0OTExMTQzNl5BMl5BanBnXkFtZTgwODQ0Nzg2MjE@._V1_SX300.jpg', '0', '0', '0', '0');
