INSERT INTO `title` VALUES ('987', 'The Intouchables', 'intouchables', '1', 'Biography, Comedy, Drama', '2011', 'http://www.imdb.com/title/tt1675434/?ref_=fn_al_tt_1', 'd:\\filmovi\\intouchables', 'After he becomes a quadriplegic from a paragliding accident, an aristocrat hires a young man from the projects to be his caregiver.', '', 'Franois Cluzet, Omar Sy, Anne Le Ny, Audrey Fleurot', 'http://ia.media-imdb.com/images/M/MV5BMTYxNDA3MDQwNl5BMl5BanBnXkFtZTcwNTU4Mzc1Nw@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('988', 'Lock, Stock and Two Smoking Barrels', 'Lock, Stock and Two Smoking Barrels', '1', 'Comedy, Crime', '1998', 'http://www.imdb.com/title/tt3522962/?ref_=fn_al_tt_1', 'd:\\filmovi\\lock stock and two smoking barrels', 'Four Jack-the-lads find themselves heavily - seriously heavily - in debt to an East End hard man and his enforcers after a crooked card game. Overhearing their neighbours in the next flat plotting to hold up a group of out-of-their-depth drug growers, our heros decide to stitch up the robbers in turn. In a way the confusion really starts when a pair of antique double-barrelled shotguns go missing in a completely different scam.', '', 'Jason Flemyng, Dexter Fletcher, Nick Moran, Jason Statham', 'http://ia.media-imdb.com/images/M/MV5BMTU4MTM1MjUxMF5BMl5BanBnXkFtZTYwOTEzODY4._V1_SX300.jpg', '0', '0', '0', '0');
