INSERT INTO `title` VALUES ('990', 'Mona Lisa Smile', 'mona lisa smile', '1', 'Drama', '2003', 'http://www.imdb.com/title/tt0304415/?ref_=fn_al_tt_1', 'd:\\filmovi\\mona lisa smile', 'A free-thinking art professor teaches conservative 1950s Wellesley girls to question their traditional social roles.', '', 'Julia Roberts, Kirsten Dunst, Julia Stiles, Maggie Gyllenhaal', 'http://ia.media-imdb.com/images/M/MV5BMTI0NjEwNDgwOV5BMl5BanBnXkFtZTYwOTI1NTA3._V1_SX300.jpg', '0', '0', '0', '0');
