INSERT INTO `title` VALUES ('993', 'Planet 51', 'planet 51', '1', 'Animation, Adventure, Comedy', '2009', 'http://www.imdb.com/title/tt0762125/?ref_=fn_al_tt_1', 'd:\\filmovi\\planet 51', 'An alien civilization is invaded by Astronaut Chuck Baker, who believes that the planet was uninhabited. Wanted by the military, Baker must get back to his ship before it goes into orbit without him.', '', 'Jessica Biel, John Cleese, Gary Oldman, Dwayne Johnson', 'http://ia.media-imdb.com/images/M/MV5BMTUyOTAyNTA5Ml5BMl5BanBnXkFtZTcwODU2OTM0Mg@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('994', 'R.I.P.D.', 'R.I.P.D.', '1', 'Action, Comedy,SciFi', '2013', 'http://www.imdb.com/title/tt1409084/?ref_=fn_al_tt_1', 'd:\\filmovi\\r.i.p.d', 'After Nick is murdered by his own partner, he joins the Rest in Peace Department to protect the world from the undeads. While working with his new partner, many undeads are seen gathering in Boston. Soon he realizes that someone close to him is behind all a plot to bring on the apocalypse.', '', 'Jeff Bridges, Ryan Reynolds, Kevin Bacon, Mary-Louise Parker', 'http://ia.media-imdb.com/images/M/MV5BMTM5OTYxNzE5N15BMl5BanBnXkFtZTcwMDU1MTQ4OQ@@._V1_SX300.jpg', '0', '0', '0', '0');
