INSERT INTO `title` VALUES ('996', 'RED 2', 'red 2', '1', 'Action, Comedy, Crime', '2013', 'http://www.imdb.com/title/tt1821694/?ref_=fn_al_tt_1', 'd:\\filmovi\\red 2 2013', 'Retired C.I.A. agent Frank Moses reunites his unlikely team of elite operatives for a global quest to track down a missing portable nuclear device.', '', 'Bruce Willis, John Malkovich, Mary-Louise Parker, Helen Mirren', 'http://ia.media-imdb.com/images/M/MV5BMjI2ODQ4ODY3Nl5BMl5BanBnXkFtZTcwNTc2NzE1OQ@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('997', 'Redemption', 'redemption', '1', 'Action, Crime, Drama', '2013', 'http://www.imdb.com/title/tt1893256/?ref_=fn_al_tt_1', 'd:\\filmovi\\redemption 2013', 'Homeless and on the run from a military court martial, a damaged ex-special forces soldier navigating London\'s criminal underworld seizes an opportunity to assume another man\'s identity -- transforming into an avenging angel in the process.', '', 'Jason Statham, Agata Buzek, Vicky McClure, Benedict Wong', 'http://ia.media-imdb.com/images/M/MV5BMjI0ODc3NjI4NV5BMl5BanBnXkFtZTcwOTc3MzI1OQ@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('998', 'Rio', 'rio', '1', 'Animation, Adventure, Comedy', '2011', 'http://www.imdb.com/title/tt1436562/?ref_=fn_al_tt_1', 'd:\\filmovi\\rio (2011) [1080p]', 'When Blu, a domesticated macaw from small-town Minnesota, meets the fiercely independent Jewel, he takes off on an adventure to Rio de Janeiro with the bird of his dreams.', '1080p', 'Karen Disher, Jason Fricchione, Sofia Scarpa Saldanha, Leslie Mann', 'http://ia.media-imdb.com/images/M/MV5BMTU2MDY3MzAzMl5BMl5BanBnXkFtZTcwMTg0NjM5NA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('999', 'Rio 2', 'rio 2', '1', 'Animation, Adventure, Comedy', '2014', 'http://www.imdb.com/title/tt2357291/?ref_=fn_al_tt_1', 'd:\\filmovi\\rio 2 (2014) [1080p]', 'It\'s a jungle out there for Blu, Jewel and their three kids after they\'re hurtled from Rio de Janeiro to the wilds of the Amazon. As Blu tries to fit in, he goes beak-to-beak with the vengeful Nigel, and meets his father-in-law.', '1080p', 'Jake T. Austin, Carlinhos Brown, Kristin Chenoweth, Jemaine Clement', 'http://ia.media-imdb.com/images/M/MV5BMTgzMDczMDYzNl5BMl5BanBnXkFtZTgwMzk2MDIwMTE@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('1000', 'RocknRolla', 'RocknRolla', '1', 'Action, Crime, Thriller', '2008', 'http://www.imdb.com/title/tt1297297/?ref_=fn_al_tt_1', 'd:\\filmovi\\rock n rolla (2008)', 'In London, a real-estate scam puts millions of pounds up for grabs, attracting some of the city\'s scrappiest tough guys and its more established underworld types, all of whom are looking to get rich quick. While the city\'s seasoned criminals vie for the cash, an unexpected player -- a drugged out rock \'n\' roller presumed to be dead but very much alive -- has a multi-million dollar prize fall into...', '', 'Gerard Butler, Tom Wilkinson, Thandie Newton, Mark Strong', 'http://ia.media-imdb.com/images/M/MV5BMTQ0NTk5Mzk2OV5BMl5BanBnXkFtZTcwMDE3NTE4MQ@@._V1_SX300.jpg', '0', '0', '0', '0');
