INSERT INTO `title` VALUES ('1002', 'Sherlock Holmes', 'sherlock holmes', '1', 'Action, Adventure, Crime', '2009', 'http://www.imdb.com/title/tt0988045/?ref_=fn_al_tt_1', 'd:\\filmovi\\sherlock holmes', 'Detective Sherlock Holmes and his stalwart partner Watson engage in a battle of wits and brawn with a nemesis whose plot is a threat to all of England.', '', 'Robert Downey Jr., Jude Law, Rachel McAdams, Mark Strong', 'http://ia.media-imdb.com/images/M/MV5BMTg0NjEwNjUxM15BMl5BanBnXkFtZTcwMzk0MjQ5Mg@@._V1_SX300.jpg', '0', '0', '0', '0');
