INSERT INTO `title` VALUES ('1006', 'Sinbad: Legend of the Seven Seas', 'sinbad  legend of the seven seas', '1', 'Animation, Adventure, Comedy', '2003', 'http://www.imdb.com/title/tt0165982/?ref_=fn_al_tt_1', 'd:\\filmovi\\sinbad - legend of the seven seas', 'The sailor of legend is framed by the goddess Eris for the theft of the Book of Peace, and must travel to her realm at the end of the world to retrieve it and save the life of his childhood friend Prince Proteus.', '', 'Brad Pitt, Catherine Zeta-Jones, Michelle Pfeiffer, Joseph Fiennes', 'http://ia.media-imdb.com/images/M/MV5BMTU1ODc3NTA0Ml5BMl5BanBnXkFtZTcwMTEwMDAwMQ@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('1007', 'Snatch.', 'Snatch.', '1', 'Comedy, Crime', '2000', 'http://www.imdb.com/title/tt0920840/?ref_=fn_al_tt_1', 'd:\\filmovi\\snatch - svinje i dijamanti', 'Turkish and his close friend/accomplice Tommy get pulled into the world of match fixing by the notorious Brick Top. Things get complicated when the boxer they had lined up gets badly beaten by Pitt, a \'pikey\' ( slang for an Irish Gypsy)- who comes into the equation after Turkish, an unlicensed boxing promoter wants to buy a caravan off the Irish Gypsies. They then try to convince Pitt not only to fight for them, but to lose for them too. Whilst all this is going on, a huge diamond heist takes place, and a fistful of motley characters enter the story, including \'Cousin Avi\', \'Boris The Blade\', \'Franky Four Fingers\' and \'Bullet Tooth Tony\'. Things go from bad to worse as it all becomes about the money, the guns, and the damned dog!', '', 'Benicio Del Toro, Dennis Farina, Vinnie Jones, Brad Pitt', 'http://ia.media-imdb.com/images/M/MV5BMTk5NzE0MDQyNl5BMl5BanBnXkFtZTcwNzk4Mjk3OA@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('1008', 'Step Up Revolution', 'Step Up Revolution', '1', 'Drama, Music, Romance', '2012', 'http://www.imdb.com/title/tt2516968/?ref_=fn_al_tt_1', 'd:\\filmovi\\step.up.4revolution.2012.bluray.720p.dts.x264-chd', 'The Mob sets the dancing against the vibrant backdrop of Miami. Emily arrives in Miami with aspirations of becoming a professional dancer and soon falls in love with Sean, a young man who leads a dance crew in elaborate, cutting-edge flash mobs, called \"The Mob\". When a wealthy business man threatens to develop The Mob\'s historic neighborhood and displace thousands-of people, Emily must work together with Sean and The Mob to turn their performance art into protest art, and risk losing their dreams to fight for a greater cause.', '720p', 'Cleopatra Coleman, Ryan Guzman, Misha Gabriel Hamilton, Michael \'Xeno\' Langebeck', 'http://ia.media-imdb.com/images/M/MV5BMjg1NjgyOTM2OF5BMl5BanBnXkFtZTcwMDIxMDE2Nw@@._V1_SX300.jpg', '0', '0', '0', '0');
INSERT INTO `title` VALUES ('1009', 'The Birdcage', 'the birdcage', '1', 'Comedy', '1996', 'http://www.imdb.com/title/tt0115685/?ref_=fn_al_tt_1', 'd:\\filmovi\\the birdcage', 'A gay cabaret owner and his drag queen companion agree to put up a false straight front so that their son can introduce them to his fiance\'s right-wing moralistic parents.', '', 'Robin Williams, Gene Hackman, Nathan Lane, Dianne Wiest', 'http://ia.media-imdb.com/images/M/MV5BMTM2NjExODYyOF5BMl5BanBnXkFtZTcwNTc0NjgyNA@@._V1_SX300.jpg', '0', '0', '0', '0');
