INSERT INTO `title` VALUES ('1011', 'The Dark Knight', 'the dark knight', '1', 'Action, Crime, Drama', '2008', 'http://www.imdb.com/title/tt0468569/?ref_=fn_al_tt_1', 'd:\\filmovi\\the dark knight', 'When the menace known as the Joker wreaks havoc and chaos on the people of Gotham, the caped crusader must come to terms with one of the greatest psychological tests of his ability to fight injustice.', '', 'Christian Bale, Heath Ledger, Aaron Eckhart, Michael Caine', 'http://ia.media-imdb.com/images/M/MV5BMTMxNTMwODM0NF5BMl5BanBnXkFtZTcwODAyMTk2Mw@@._V1_SX300.jpg', '0', '0', '0', '0');
