INSERT INTO `title` VALUES ('1017', 'The Secret Life of Walter Mitty', 'the secret life of walter mitty', '1', 'Adventure, Comedy, Drama', '2013', 'http://www.imdb.com/title/tt0359950/?ref_=fn_al_tt_1', 'd:\\filmovi\\the secret life of walter mitty', 'When his job along with that of his co-worker are threatened, Walter takes action in the real world embarking on a global journey that turns into an adventure more extraordinary than anything he could have ever imagined.', '', 'Ben Stiller, Kristen Wiig, Jon Daly, Kathryn Hahn', 'http://ia.media-imdb.com/images/M/MV5BODYwNDYxNDk1Nl5BMl5BanBnXkFtZTgwOTAwMTk2MDE@._V1_SX300.jpg', '0', '0', '0', '0');
