INSERT INTO `title` VALUES ('1835', 'Another World', 'Another World', '1', 'Action, Horror, SciFi', '2014', 'http://www.imdb.com/title/tt5466306/?ref_=fn_al_tt_1', 'd:\\filmovi\\another.world.2015.720p.web-dl.750mb.mkvcage.mkv', 'The movie is a post-apocalyptic horror/science fiction film. the setting is in a near post apocalyptic future where a biological warfare program goes wrong, and turns most of humanity to mindless, murderous creatures (hence forth - \"infected\"). There are five characters, which are still uninfected, trying to survive constant attacks by the infected. each one of them represents in some way a different aspect of human existence, a different world-view, but most important, a different moral view about the world and his/her place in it - The Colonel - A professional soldier. represents the political-military-economic establishment, which sees life as a constant violent struggle for power and resources. The Doctor - Represents a commitment to love, justice and non-violent struggle against all wrong. The Wizard - A young man, an inventor and an autodidact scientist, who looks at life as a puzzle to be solved. he strives to discover, understand and invent, with no thought as to the consequences. The Daughter - A simple girl with simple ambitions - sailing through life enjoying every comfort, while ignoring or unaware of bigger and more profound issues. The Mouser - A murderer and rapist, evil in the most banal aspect of the word. The plot takes place during their last six days. all along, as the characters evolve, they listen to a daily radio program dealing with the extinction of the dinosaurs, finding correlating themes to their own situation. as the protagonists move and try to survive, and as their world views and correlations to the situation are gradually reveled, the following themes are explored: the essence of evil, the boundaries of moral responsibility, species (and humankind) extinction, love, grace, euthanasia and more.', '720p', 'Larry Butchins, Zach Cohen, Susanne Gschwendtner, Davina Kevelson', 'http://ia.media-imdb.com/images/M/MV5BMjIzMTA5Mjk1NF5BMl5BanBnXkFtZTgwNDkzNDY5NjE@._V1_SX300.jpg', '0', '0', '0', '0');
